import React, { Component } from "react";

class Songs extends Component {
  render() {
    return (
      <div>
        {this.props.songs.map(song => {
          return (
            <div key={song.url}>
              <span>
                <img src={song.image[2]["#text"]} />
                <b>
                  <p>{song.name}</p>
                </b>
                <p>{song.artist.name}</p>
              </span>
            </div>
          );
        })}
      </div>
    );
  }
}

export default Songs;
